import React from 'react';
import { useCookies } from 'react-cookie';

function Bot() {
  const [cookies] = useCookies(['user']);

  // Check if the 'user' cookie exists
  if (!cookies.user) {
    return <div>No user cookie found!</div>;
  }

  return (
    <div>
      <h1>User Cookie Content</h1>
      <pre>{JSON.stringify(cookies.user, null, 2)}</pre>
    </div>
  );
}

export default Bot;
